import React from "react";
import ReactRotatingText from "react-rotating-text";
import Container from "../components/Container";
import "./index.css";

const index = () => {
  return (
    <Container>
      <p>Hi,</p>
      <h1>I'm Dani Vijay</h1>
      <p>Your friendly neighborhood Full Stack Web Developer</p>
      <p>
        I love working with JavaScript based tech, there is a high chance of
        finding me working with MERN stack at the moment.
      </p>
      <p>
        I've worked extensively on ReactJS, Node with ExpressJS, VueJS, Ruby on
        Rails, MongoDB and MySQL.
      </p>
      <p>
        I like to try and learn new stuff, that includes{" "}
        <ReactRotatingText
          items={[
            "Lambda Functions",
            "VueJS",
            "PHP",
            "Bash",
            "Firebase",
            "AWS API Gateway"
          ]}
        />
      </p>
    </Container>
  );
};

export default index;
